import React from 'react';
import styled from "styled-components";

function Login() {
  return (
    <Container>
     <Nav>
            <NavMenu >
                <a>
                    <img src="/images/home-icon.svg"/>
                    <span>HOME</span>
                </a>
                <a>
                    <img src="/images/search-icon.svg"/>
                    <span>SEARCH</span>
                </a>
                <a>
                    <img src="/images/watchlist-icon.svg"/>
                    <span>WATCHLIST</span>
                </a>
                <a>
                    <img src="/images/original-icon.svg"/>
                    <span>ORIGINALS</span>
                </a>
                <a>
                    <img src="/images/movie-icon.svg"/>
                    <span>MOVIES</span>
                </a>
                <a>
                    <img src="/images/series-icon.svg"/>
                    <span>SERIES</span>
                </a>
            </NavMenu>
        </Nav>
    <Nav_logo
        src="/images/mouse-clicker.png"
        alt="netflix_logo"/>
    <Login_Container><Login2>Login</Login2></Login_Container>    
    </Container>
  )
}

const Container=styled.main`
    height: 100%;
    position:relative;
    overflow:hidden;
    background: url("/images/valoImg.jpg") center no-repeat;
        background-size: cover;
        content:"";
        position: absolute;
        top:0;
        left:0;
        right:0;
        bottom:0;
        z-index:-1;
`

const Nav_logo=styled.img`
    position: fixed;
    top:10px;
    left: 20px;
    width: 70px;
    object-fit: contain;
`

const Login2=styled.a`
   background-color: rgba(255, 48, 64,0.8);;
   padding: 8px 16px;
   text-transform: uppercase;
   letter-spacing:1.8px;
   border: 1px solid #f9f9f9;
   border-radius:4px;
   transition: all 250ms ease 0s;
   cursor:pointer;

   &:hover{
       background-color:rgb(255, 48, 64);
       color:#000;
       border-color:transparent;
   }
`

const Login_Container=styled.div`
    flex: 1;
    display:flex;
    justify-content: flex-end;
`



export default Login
